import React from 'react';
import './image.css'

const image = (props) => {

    const handledelete = () =>{
        props.setoption(0);
    }
  return (
    <div className='fullcontainer'>
    <div className='img'>
     <img src={props.imgaddress}/>
     <div className='btnn'>
     <button>Rotate</button> 
     <button>Crop</button>
     <button>Contrast</button>
     <button>brightness</button>
     <button onClick={handledelete}>Delete</button>
     </div>
     <div className='btn'><button>Keep Scanning</button> <button className='pdfbtn'>Save PDF</button></div>
    </div>
    
    </div>
  )
}

export default image
